def read_csv(filename, list_name):
    f = csv.reader(open(filename, 'r'))
    for i in f:
        list_name.append(i)


def cal_f1_score(yesid, noid, real_test, samplesubmission):
	tp = 0.0
	fp = 0.0
	fn = 0.0
	tn = 0.0

	for i in range(0, len(real_test)):
		a = float(samplesubmission[i+1][-1])
		if a<0.5:a=0
		else: a=1
		b = int(real_test[i])
		if a == yesid and b == yesid:
			tp += 1
		elif a == yesid and b == noid:
			fp += 1
		elif a == noid and b == yesid:
			fn += 1
		elif a == noid and b == noid:
			tn += 1
		else:
			print("Error in line 41!")
			sys.exit(3)

	Precision = tp / (tp + fp)
	Recall = tp / (tp + fn)
	f_1 = 2 * Precision * Recall / (Precision + Recall)

	return f_1



